  [],\n\t\"revision_timestamp\": \"2015-09-26T19:44:50.365913\",\n\t\"name\": \"ocean-surface-topography-mission-ostm-jason-2-auxiliary-files-nodc-accession-0044983\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This accession contains the data descriptions
  for the OSTM/Jason-2 Auxiliary data files, which is served through the NOAA/NESDIS
  Comprehensive Large Array-data Stewardship System (CLASS): http://www.class.noaa.govnnOSTM/Jason-2
  is a follow-on mission to Jason-1, which takes over and continues the TOPEX/Poseidon
  and Jason-1 missions. OSTM/Jason-2 involves Centre National d'Etudes Spatiales (CNES),
  NASA and 2 new partners: the European Organisation for the Exploitation of Meteorological
  Satellites (EUMETSAT) and NOAA in order to 1) ensure continuity of high quality
  measurements for ocean science, and 2) provide operational products for assimilation
  and forecasting applications. OSTM/Jason-2 was launched on 20 June 2008 and reached
  its nominal repetitive orbit on 4 July 2008. The start of cycle 1 occurred on 12
  July 2008.nnThese auxiliary data files are used to generate Level-2 products.They
  Include both static tabular data files and dynamic files which change/grow over
  time. Auxiliary files are produced outside of OSTM but are used in the production
  of Level-2 products. Filetypes in the Auxiliary data family (J2-AUX) which are produced
  by the European Center for Medium range Weather Forecasting (ECMWF) are restricted
  by ECMWF to the Jason-2 project team. For these restricted data families, users
  will only see listed those datatypes upon which they can search.nnOther data/products
  associated with OSTM/Jason-2 are also provided through CLASS. They are: Level-2
  Geophysical Data Records (GDRs), ancillary data files used to generate Level-2 products,
  quality reports from the near real-time altimetry validation system (NRTAVS), orbit
  information of JASON-2 satellite and telemetry data. The descriptions of these data
